import React from "react";

const EmailCert = ({ loginData }) => {
    return (
        <div className="signup_wrap">
            <form>
                <h2>이메일 인증</h2>
                <div className="signup_form">
                    <p>
                        <input 
                            className="cert"
                            type="text" name="cert" 
                            placeholder="인증 번호를 입력해주세요."
                        value={loginData.username}
                        onChange={change}
                        />
                    </p>
                </div>

            </form>
        </div>
    )
}

export default EmailCert;
